import React, { Component } from 'react'
import {
    Accordion,
    AccordionItem,
    AccordionItemTitle,
    AccordionItemBody,
} from 'react-accessible-accordion';

class LocationFilter extends Component {
  render() {
    return (
      <div>
        Hello World
      </div>
    )
  }
}

export default LocationFilter
